import './Prologue.css';

function Prologue(){
    return(
        <div className='Prologue'>
            <div className='Prologue-Title'>Prologue of COOKIEDOG</div>
            <div className='Content-En'>In an unknown world in a vast digital space like the universe, No one knows<br></br>There was a place called Coasis, a sweet world of dreams where chocolate and milk flow.</div>
            <div className='Content-Kr'>우주와 같이 넓은 디지털 공간 속 어느 미지의 세계에 <br></br>초콜릿과 우유가 흐르는 달콤한 꿈의 세계 코아시스라는 곳이 있었다.</div>
        </div>
    )
}

export default Prologue;
